    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge summarizes Refuge activities from January through April of 1961.
     The report begins with a summary of the weather conditions, water conditions,
    and fires during the period.  Wildlife- including migratory birds, upland game birds,
    big game animals, fur animals, predacious birds, fish, and reptiles- is also covered.
     The report includes a Refuge development and maintenance section which discusses
    physical developments, control of vegetation, prescribed burning, and fires.  Resource
    management is outlined; topics include timber removal.  A progress report on field
    investigations and applied research is also provided.  The public relations section
    of the report discusses recreational use of the Refuge, Refuge visitors, Refuge
    participation, and violations.  Items of interest, N-R forms, and photographs are
    provided at the end of the report.",nt"license_title": "License Not Specified",nt"extras":
